import React from "react";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from "./compoent/Navbar";
import PatientDashboard from "./compoent/PatientDashboard";
import DoctorDashboard from "./compoent/DoctorDashboard";
import Home from "./compoent/Home";
import Doctors from "./compoent/Doctors";
import CreateAppointment from "./compoent/CreateAppointment";
import Contact from "./compoent/Contact";
import Services from "./compoent/Services";
import Doctorlogin from "./compoent/Doctorlogin";
import DoctorRegister from "./compoent/DoctorRegister";
import PatientLogin from "./compoent/PatientLogin";
import PatientRegister from "./compoent/PatientRegister";
import Footer from "./compoent/Footer";
import Routes from "./Routes"; // Make sure you import this component

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <Route path='/' component={Home} exact>
            <Home />
          </Route>
          <Route path='/doctors' component={Doctors} exact>
            <Doctors />
          </Route>
          <Route path='/createappointment' component={CreateAppointment} exact>
            <CreateAppointment />
          </Route>
          <Route path='/contact' component={Contact} exact>
            <Contact />
          </Route>
          <Route path='/services' component={Services} exact>
            <Services />
          </Route>
          <Route path='/doctorlogin' component={Doctorlogin} exact>
            <Doctorlogin />
          </Route>
          <Route path='/doctorregister' component={DoctorRegister} exact>
            <DoctorRegister />
          </Route>
          <Route path='/patientlogin' component={PatientLogin} exact>
            <PatientLogin />
          </Route>
          <Route path='/patientregister' component={PatientRegister} exact>
            <PatientRegister />
          </Route>
          <Route path='/patientdashboard' component={PatientDashboard} exact>
            <PatientDashboard />
          </Route>
          <Route path='/doctordashboard' component={DoctorDashboard} exact>
            <DoctorDashboard />
          </Route>
        </Switch>
        <Routes />
        <Footer />
      </Router>
    </>
  )
}

export default App;
